import './App.css';
import Header from "./components/Header";
import Index from "./pages/Index"
import { BrowserRouter, Link, Routes, Route } from "react-router-dom";
import CategorieCafe from "./pages/CategorieCafe";
import CategorieThe from "./pages/CategorieThe";
import MeilleuresVentes from './pages/MeilleursVentes';
import Populaire from './pages/Populaire';
import Promos from './pages/Promos';
import Produits from './pages/Produits';
import Connexion from './pages/Connexion';
import Inscription from './pages/Inscription';
import Produit from './pages/Produit';

function App() {
    return (
        <>
            <div className="App">
                <BrowserRouter>
                    <Header />
                    <Routes>
                        <Route exact path="/" element={<Index />} />
                        <Route exact path="/produits" element={<Produits />} />
                        <Route path="/cafe" element={<CategorieCafe />} />
                        <Route path="/the" element={<CategorieThe />} />
                        <Route path="/infusion" element={<CategorieThe />} />
                        <Route path="/meilleures_ventes" element={<MeilleuresVentes />} />
                        <Route path="/populaire" element={<Populaire />} />
                        <Route path="/promos" element={<Promos />} />
                        <Route path="/connexion" element={<Connexion />} />
                        <Route path="/inscription" element={<Inscription />} />
                        <Route path="/produits/:id" element={<Produit />} />
                        <Route path="/produits/cafe" element={<Produit />} />
                    </Routes>
                </BrowserRouter>
            </div>
        </>
    );
}

export default App;
